void execute::thread_ap_clk_no_reset_() {
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_blockControl_U0_ap_ready = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (ap_start.read() & 
             ap_hs_ready.read()))) {
            ap_sync_reg_blockControl_U0_ap_ready = ap_const_logic_0;
        } else {
            ap_sync_reg_blockControl_U0_ap_ready = ap_sync_blockControl_U0_ap_ready.read();
        }
    }
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_sync_reg_execute_entry206_U0_ap_ready = ap_const_logic_0;
    } else {
        if (esl_seteq<1,1,1>(ap_const_logic_1, (ap_start.read() & 
             ap_hs_ready.read()))) {
            ap_sync_reg_execute_entry206_U0_ap_ready = ap_const_logic_0;
        } else {
            ap_sync_reg_execute_entry206_U0_ap_ready = ap_sync_execute_entry206_U0_ap_ready.read();
        }
    }
    if ((esl_seteq<1,1,1>(blockControl_U0_ap_ready.read(), ap_const_logic_0) && 
         esl_seteq<1,1,1>(ap_const_logic_1, ap_hs_ready.read()))) {
        blockControl_U0_ap_ready_count = (!blockControl_U0_ap_ready_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(blockControl_U0_ap_ready_count.read()) - sc_biguint<2>(ap_const_lv2_1));
    } else if ((esl_seteq<1,1,1>(ap_const_logic_1, blockControl_U0_ap_ready.read()) && 
                esl_seteq<1,1,1>(ap_hs_ready.read(), ap_const_logic_0))) {
        blockControl_U0_ap_ready_count = (!blockControl_U0_ap_ready_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(blockControl_U0_ap_ready_count.read()) + sc_biguint<2>(ap_const_lv2_1));
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_hs_ready.read()) && 
         esl_seteq<1,1,1>(execute_entry206_U0_ap_ready.read(), ap_const_logic_0))) {
        execute_entry206_U0_ap_ready_count = (!execute_entry206_U0_ap_ready_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(execute_entry206_U0_ap_ready_count.read()) - sc_biguint<2>(ap_const_lv2_1));
    } else if ((esl_seteq<1,1,1>(ap_hs_ready.read(), ap_const_logic_0) && 
                esl_seteq<1,1,1>(execute_entry206_U0_ap_ready.read(), ap_const_logic_1))) {
        execute_entry206_U0_ap_ready_count = (!execute_entry206_U0_ap_ready_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(execute_entry206_U0_ap_ready_count.read()) + sc_biguint<2>(ap_const_lv2_1));
    }
}

